import React, { useState, useEffect } from 'react';
import { 
  BarChart, Bar, LineChart, Line, PieChart, Pie, Cell, XAxis, YAxis, CartesianGrid, 
  Tooltip, Legend, ResponsiveContainer, AreaChart, Area, ScatterChart, Scatter, 
  ZAxis, ComposedChart, RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis, 
  Radar, RadialBarChart, RadialBar
} from 'recharts';
import './EngineerCharts.css';

const EngineerCharts = ({ data, filters }) => {
  const [activeChart, setActiveChart] = useState('stages');
  const [timeRange, setTimeRange] = useState('7d');
  const [chartData, setChartData] = useState({});
  const [loading, setLoading] = useState(false);
  const [engineerData, setEngineerData] = useState(null);

  useEffect(() => {
    fetchEngineerData();
  }, [filters]);

  useEffect(() => {
    if (engineerData) {
      processChartData();
    }
  }, [engineerData, timeRange]);

  const fetchEngineerData = async () => {
    setLoading(true);
    try {
      const token = localStorage.getItem('token');
      const queryParams = new URLSearchParams();
      
      if (filters.domain_id) queryParams.append('domain_id', filters.domain_id);
      if (filters.project_id) queryParams.append('project_id', filters.project_id);
      if (filters.block_name) queryParams.append('block_name', filters.block_name);
      if (filters.experiment) queryParams.append('experiment', filters.experiment);
      if (filters.stage) queryParams.append('stage', filters.stage);
      if (filters.run_status) queryParams.append('run_status', filters.run_status);
      if (filters.user_id) queryParams.append('user_id', filters.user_id);
      if (filters.start_date) queryParams.append('start_date', filters.start_date);
      if (filters.end_date) queryParams.append('end_date', filters.end_date);

      const response = await fetch(`http://localhost:5000/api/data/engineer-chart-data?${queryParams}`, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        const data = await response.json();
        setEngineerData(data);
      } else {
        console.error('Failed to fetch engineer data');
      }
    } catch (error) {
      console.error('Error fetching engineer data:', error);
    } finally {
      setLoading(false);
    }
  };

  const processChartData = () => {
    if (!engineerData) return;

    const processed = {};

    // 1. Stage-wise Analysis
    processed.stages = processStageData();
    
    // 2. Area Trends
    processed.areaTrends = processAreaTrends();
    
    // 3. Internal Timing Analysis
    processed.internalTiming = processInternalTiming();
    
    // 4. Utilization Analysis
    processed.utilization = processUtilizationData();
    
    // 5. Interface Timing Analysis
    processed.interfaceTiming = processInterfaceTiming();
    
    // 6. Congestion Analysis
    processed.congestion = processCongestionData();
    
    // 7. Performance Metrics
    processed.performance = processPerformanceMetrics();
    
    // 8. Runtime Analysis
    processed.runtime = processRuntimeData();

    setChartData(processed);
  };

  const processStageData = () => {
    return engineerData.stageAnalysis.map(stage => ({
      stage: stage.stage || 'Unknown',
      total: stage.total_runs,
      pass: stage.pass_count,
      fail: stage.fail_count,
      continue_with_error: stage.error_count,
      avg_area: parseFloat(stage.avg_area) || 0,
      avg_utilization: parseFloat(stage.avg_utilization) || 0,
      avg_runtime: parseFloat(stage.avg_runtime) || 0
    }));
  };

  const processAreaTrends = () => {
    return engineerData.areaTrends.map(trend => ({
      date: new Date(trend.date).toLocaleDateString(),
      area: parseFloat(trend.avg_area) || 0,
      run_count: trend.run_count,
      utilization: parseFloat(trend.avg_utilization) || 0
    }));
  };

  const processInternalTiming = () => {
    return engineerData.internalTiming.map(timing => ({
      block: timing.block_name,
      internal_timing: timing.internal_timing,
      count: timing.count,
      avg_area: parseFloat(timing.avg_area) || 0,
      avg_utilization: parseFloat(timing.avg_utilization) || 0
    }));
  };

  const processUtilizationData = () => {
    return engineerData.utilizationAnalysis.map(util => ({
      block: util.block_name,
      utilization: parseFloat(util.avg_utilization) || 0,
      run_count: util.run_count,
      avg_area: parseFloat(util.avg_area) || 0,
      avg_runtime: parseFloat(util.avg_runtime) || 0
    }));
  };

  const processInterfaceTiming = () => {
    return engineerData.interfaceTiming.map(interfaceData => ({
      block: interfaceData.block_name,
      interface_timing: interfaceData.interface_timing,
      count: interfaceData.count,
      avg_area: parseFloat(interfaceData.avg_area) || 0
    }));
  };

  const processCongestionData = () => {
    return engineerData.congestionAnalysis.map(congestion => ({
      block: congestion.block_name,
      congestion: congestion.congestion_drc_metrics,
      count: congestion.count,
      avg_area: parseFloat(congestion.avg_area) || 0,
      avg_utilization: parseFloat(congestion.avg_utilization) || 0
    }));
  };

  const processPerformanceMetrics = () => {
    return engineerData.performanceMetrics.map(metric => ({
      block: metric.block_name,
      area: parseFloat(metric.area_um2) || 0,
      utilization: parseFloat(metric.utilization) || 0,
      runtime: parseInt(metric.runtime_seconds) || 0,
      status: metric.run_status,
      stage: metric.stage
    }));
  };

  const processRuntimeData = () => {
    // Use area trends data for runtime trends since it has date information
    return engineerData.areaTrends.map(trend => ({
      date: new Date(trend.date).toLocaleDateString(),
      runtime: parseFloat(trend.avg_runtime) || 0,
      run_count: trend.run_count,
      area: parseFloat(trend.avg_area) || 0
    }));
  };

  const renderStageAnalysis = () => (
    <div className="chart-section">
      <h3>Stage-wise Analysis</h3>
      <div className="charts-grid">
        <div className="chart-card">
          <h4>Stage Status Distribution</h4>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={chartData.stages}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="stage" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Bar dataKey="pass" stackId="a" fill="#16a34a" name="Pass" />
              <Bar dataKey="fail" stackId="a" fill="#dc2626" name="Fail" />
              <Bar dataKey="continue_with_error" stackId="a" fill="#f59e0b" name="Error" />
            </BarChart>
          </ResponsiveContainer>
        </div>
        
        <div className="chart-card">
          <h4>Average Area by Stage</h4>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={chartData.stages}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="stage" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="avg_area" fill="#6366f1" name="Avg Area (um)" />
            </BarChart>
          </ResponsiveContainer>
        </div>
        
        <div className="chart-card">
          <h4>Average Utilization by Stage</h4>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={chartData.stages}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="stage" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="avg_utilization" fill="#10b981" name="Avg Utilization (%)" />
            </BarChart>
          </ResponsiveContainer>
        </div>
        
        <div className="chart-card">
          <h4>Average Runtime by Stage</h4>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={chartData.stages}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="stage" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="avg_runtime" fill="#f59e0b" name="Avg Runtime (sec)" />
            </BarChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );

  const renderAreaTrends = () => (
    <div className="chart-section">
      <h3>Area Trends Analysis</h3>
      <div className="charts-grid">
        <div className="chart-card">
          <h4>Area Trends Over Time</h4>
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={chartData.areaTrends}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="date" />
              <YAxis />
              <Tooltip />
              <Line type="monotone" dataKey="area" stroke="#6366f1" strokeWidth={2} />
            </LineChart>
          </ResponsiveContainer>
        </div>
        
        <div className="chart-card">
          <h4>Area vs Utilization Scatter</h4>
          <ResponsiveContainer width="100%" height={300}>
            <ScatterChart>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="area" name="Area (um)" />
              <YAxis dataKey="utilization" name="Utilization (%)" />
              <Tooltip />
              <Scatter data={chartData.areaTrends} fill="#6366f1" />
            </ScatterChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );

  const renderInternalTiming = () => (
    <div className="chart-section">
      <h3>Internal Timing Analysis</h3>
      <div className="charts-grid">
        <div className="chart-card">
          <h4>Internal Timing by Block</h4>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={chartData.internalTiming}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="block" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="internal_timing" fill="#8b5cf6" name="Internal Timing" />
            </BarChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );

  const renderUtilization = () => (
    <div className="chart-section">
      <h3>Utilization Analysis</h3>
      <div className="charts-grid">
        <div className="chart-card">
          <h4>Utilization Distribution</h4>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={chartData.utilization}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="block" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="utilization" fill="#10b981" name="Utilization (%)" />
            </BarChart>
          </ResponsiveContainer>
        </div>
        
        <div className="chart-card">
          <h4>Utilization vs Runtime</h4>
          <ResponsiveContainer width="100%" height={300}>
            <ScatterChart>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="utilization" name="Utilization (%)" />
              <YAxis dataKey="avg_runtime" name="Runtime (sec)" />
              <Tooltip />
              <Scatter data={chartData.utilization} fill="#10b981" />
            </ScatterChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );

  const renderInterfaceTiming = () => (
    <div className="chart-section">
      <h3>Interface Timing Analysis</h3>
      <div className="charts-grid">
        <div className="chart-card">
          <h4>Interface Timing by Block</h4>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={chartData.interfaceTiming}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="block" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="interface_timing" fill="#06b6d4" name="Interface Timing" />
            </BarChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );

  const renderCongestion = () => (
    <div className="chart-section">
      <h3>Congestion Analysis</h3>
      <div className="charts-grid">
        <div className="chart-card">
          <h4>Congestion Metrics by Block</h4>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={chartData.congestion}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="block" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="congestion" fill="#ef4444" name="Congestion" />
            </BarChart>
          </ResponsiveContainer>
        </div>
        
        <div className="chart-card">
          <h4>Congestion vs Utilization</h4>
          <ResponsiveContainer width="100%" height={300}>
            <ScatterChart>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="utilization" name="Utilization (%)" />
              <YAxis dataKey="congestion" name="Congestion" />
              <Tooltip />
              <Scatter data={chartData.congestion} fill="#ef4444" />
            </ScatterChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );

  const renderPerformance = () => (
    <div className="chart-section">
      <h3>Performance Metrics</h3>
      <div className="charts-grid">
        <div className="chart-card">
          <h4>Area vs Runtime Performance</h4>
          <ResponsiveContainer width="100%" height={300}>
            <ScatterChart>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="area" name="Area (um)" />
              <YAxis dataKey="runtime" name="Runtime (sec)" />
              <ZAxis dataKey="utilization" range={[100, 400]} />
              <Tooltip />
              <Scatter data={chartData.performance} fill="#6366f1" />
            </ScatterChart>
          </ResponsiveContainer>
        </div>
        
        <div className="chart-card">
          <h4>Runtime Trends</h4>
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={chartData.runtime}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="date" />
              <YAxis />
              <Tooltip />
              <Line type="monotone" dataKey="run_count" stroke="#f59e0b" strokeWidth={2} />
            </LineChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );

  const renderChartContent = () => {
    switch (activeChart) {
      case 'stages':
        return renderStageAnalysis();
      case 'area':
        return renderAreaTrends();
      case 'internal-timing':
        return renderInternalTiming();
      case 'utilization':
        return renderUtilization();
      case 'interface-timing':
        return renderInterfaceTiming();
      case 'congestion':
        return renderCongestion();
      case 'performance':
        return renderPerformance();
      default:
        return renderStageAnalysis();
    }
  };

  if (loading) {
    return (
      <div className="engineer-charts">
        <div className="charts-loading">
          <div>Loading engineer analytics...</div>
        </div>
      </div>
    );
  }

  if (!engineerData) {
    return (
      <div className="engineer-charts">
        <div className="charts-empty">
          <h4>No Data Available</h4>
          <p>Please select filters to view engineer analytics</p>
        </div>
      </div>
    );
  }

  return (
    <div className="engineer-charts">
      <div className="charts-header">
        <h2>Engineer Analytics Dashboard</h2>
        <div className="chart-controls">
          <div className="chart-tabs">
            <button 
              className={activeChart === 'stages' ? 'active' : ''}
              onClick={() => setActiveChart('stages')}
            >
              Stages
            </button>
            <button 
              className={activeChart === 'area' ? 'active' : ''}
              onClick={() => setActiveChart('area')}
            >
              Area Trends
            </button>
            <button 
              className={activeChart === 'internal-timing' ? 'active' : ''}
              onClick={() => setActiveChart('internal-timing')}
            >
              Internal Timing
            </button>
            <button 
              className={activeChart === 'utilization' ? 'active' : ''}
              onClick={() => setActiveChart('utilization')}
            >
              Utilization
            </button>
            <button 
              className={activeChart === 'interface-timing' ? 'active' : ''}
              onClick={() => setActiveChart('interface-timing')}
            >
              Interface Timing
            </button>
            <button 
              className={activeChart === 'congestion' ? 'active' : ''}
              onClick={() => setActiveChart('congestion')}
            >
              Congestion
            </button>
            <button 
              className={activeChart === 'performance' ? 'active' : ''}
              onClick={() => setActiveChart('performance')}
            >
              Performance
            </button>
          </div>
        </div>
      </div>
      
      <div className="charts-content">
        {renderChartContent()}
      </div>
    </div>
  );
};

export default EngineerCharts;
